import { useGSAP } from "@gsap/react";
import gsap from "gsap";
import React,{useEffect} from "react";
function Project()
{
   useGSAP(()=>{
    gsap.from('#team',{
        opacity:0,
        scale:1,
        y:50,
        duration:1.5
        
    })
   })
   
    return(
       
        <div id="team">
         <h1>WE DESIGN </h1>
         <h1> TAILOR-MADE</h1>
         <h1>IMMERSIVE</h1>
         <h1>EXPERIENCES</h1>
         <h1> BY ALWAYS</h1>
         <h1>COMBINING</h1> 
         <h1>FREEDOM</h1>     
        </div>
    )
}
export default Project;
